/**
* Controla o select de idiomas no footer
**/

(function($) {
  const selectLanguage = {
    init: function () {
      this.setup();
      this.bind();
      this.locale();
    },

    setup: function () {
      const that = this;
      that.$container = $('#listaIdiomas');
    },

    bind: function() {
      const that = this;
      $(window).on('click', { 'that': that }, that.hideOptions);

      that.$container.find('.dropdown-toggle').on('click', { 'that': that }, that.toggleOptions);
      that.$container.find('.dropdown-menu .dropdown-item').last().on('blur', { 'that': that }, that.hideOptions);
    },

    toggleOptions: function(e) {
      e.preventDefault();
      const that = e.data.that,
        windowBottom = $(window).scrollTop() + $(window).height(),
        optionsElementBottomOffset = $(this).offset().top + 100,
        shouldOpenUp = windowBottom < optionsElementBottomOffset;
        
      (shouldOpenUp) 
        ? that.$container.find('.dropdown-menu').addClass('up') 
        : that.$container.find('.dropdown-menu').removeClass('up');
      
      that.$container.addClass('show');
      that.$container.find('.dropdown-toggle').attr('aria-expanded', true);
      that.$container.find('.dropdown-menu .dropdown-item').first().focus();
      e.stopPropagation();
    },

    hideOptions: function(e) {
      const that = e.data.that;
      that.$container.removeClass('show');
      that.$container.find('.dropdown-toggle').attr('aria-expanded', false);
    },

    locale: function() {
      function changeLocale (locale) {
        document.cookie = `locale_js=${locale}; path=/`;
        window.location.reload();
        return false;
      };

      $('.item-locale').on('click', function(event) {
        event.preventDefault();
        const locale = $(this).attr('data-testid');
        changeLocale(locale);
      });
    },
  };

  selectLanguage.init();
})($);
/**
* Módulo responsavel pela página de login.
**/

define('loginCandidatos', ['jquery'], function($) {
  const loginCandidatos = {

    init: function() {
      this.formSetup();
      this.showPassword();
      this.selectLang();
      this.gtmEvents();
    },

    formSetup: function() {
      $('#new_login_candidatos_form').formValidator().formHelper();
      $('#submitLogin').click(function () {
        loginCandidatos.loading('show');
      });
    },

    showPassword: function() {
      $('.login_candidatos_form_senha .show-password').on('click', function(e) {
        e.preventDefault();
        const $input = $(this).siblings('input'),
            inputType = $input.attr('type');
            $icon = $(this).children()[0];

        $(this).fadeOut(100, function() {
          switch (inputType) {
            case 'password':
              $input.attr('type', 'text');
              $($icon)
                .removeClass('bx-show')
                .addClass('bx-hide');
              break;
            case 'text':
              $input.attr('type', 'password');
              $($icon)
                .removeClass('bx-hide')
                .addClass('bx-show');
              break
            default:
              break;
          }
          $(this).fadeIn(100);
        });
      });
    },

    selectLang: function() {
      let isRequesting = false;
      const loginForm = $('#new_login_candidatos_form');
      const inputEmail = $('#login_candidatos_form_usuario', loginForm);
      const inputPasswd = $('#login_candidatos_form_senha', loginForm);
      const LanguageContainer = $('.login_candidatos_form_idioma_id', loginForm);
      const languageList = $('.controls span', LanguageContainer);
      const submitButton = $('#submitLogin', loginForm);
      const emailRegex = /[\w+\-.]+@[a-z\d\-]+(\.[a-z]+)*\.[a-z]{2,3}/gi;

      inputEmail.focus();

      const isValidEmail = value => emailRegex.test(value);
      const isAllfieldsFilled = () => (inputEmail.val().length > 0) && (inputPasswd.val().length > 0) && isRequesting !== true;
    
      const handleSubmitButtonDisabled = () => {
        return (isAllfieldsFilled()) 
          ? submitButton.removeClass('disabled')
          : submitButton.addClass('disabled');
      };

      function getLanguagesIds(email) {
        isRequesting = !isRequesting;

        if(isRequesting) loginCandidatos.loading('show');

        return $.get(`/login-candidatos/idiomas?email=${email}`)
          .done(( res ) => {
            isRequesting = false;
            loginCandidatos.loading('hide');
            if (!res.idioma_obrigatorio) {
              LanguageContainer.removeClass('active');
              return false;
            } else {
              const resLanguagueList = res.idioma_ids;

              LanguageContainer.addClass('active');
              
              languageList.each(function() {
                const inputThis = $('input', this);
                const firstCheckboxValue = $('input', languageList[0])
                const _thisVal = inputThis.val();

                if (resLanguagueList.includes(parseInt(_thisVal, 10))){
                  inputThis.parents('span').addClass('active');
                  firstCheckboxValue.prop('checked', true);
                }
              });
              loginCandidatos.loading('hide');
            }
          })
          .fail((error) => {
            isRequesting = false;
            loginCandidatos.loading('hide');
            LanguageContainer.removeClass('active');
            throw new Error(error);
          });
      }

      inputPasswd.on('focus', () => {
        if (!LanguageContainer.hasClass('active')) {
          inputEmail.focusout();
        }
      });

      inputPasswd.on('keyup', () => {
        handleSubmitButtonDisabled();
      });

      inputPasswd.on('change', () => {
        handleSubmitButtonDisabled();
      });

      inputEmail.on('focusout', () => {
        const emailValue = inputEmail.val();
        
        if (!isValidEmail(emailValue)) { 
          handleSubmitButtonDisabled();
          return false;
        }
        
        return getLanguagesIds(emailValue);
      });

      inputEmail.on('change', () => {
        LanguageContainer.removeClass('active');
        loginCandidatos.loading('hide');
        languageList.each(function() {
          $(this).removeClass('active');
        });
      });

      $('.lang-toggle-link').on('click', function(e){
        e.preventDefault();
        const currentTab = $(this).attr('id').toString();
    
        $('.lang-toggle-link').each(function() {
          ($(this).attr('id').toString() === currentTab) 
            ? $(this).toggleClass('is-active')
            : $(this).removeClass('is-active');
        });
        
        $('.lang-menu').each(function() {
          ($(this).attr('data-content').toString() === currentTab)
            ? $(this).toggleClass('is-active')
            : $(this).removeClass('is-active');
        });
      });
      
      $('.lang-menu-item').on('click', function(event) {
        event.preventDefault();
        const locale = $(this).attr('data-testid');
        
        document.cookie = `locale_js=${locale}; path=/`;
        location.reload();
      });

      $(document).ready(() => {
        handleSubmitButtonDisabled();
      });
    },

    gtmEvents: function() {
      window.dataLayer = window.dataLayer || [];

      const $inputLoginValue = document.getElementById('login_candidatos_form_usuario');
      const $inputPasswordValue = document.getElementById('login_candidatos_form_senha');
      const $submitLogin = document.getElementById('submitLogin');
      const $createProfile = document.getElementById('createProfile');
      const $recoverAccess = document.getElementById('recoverAccess');
      const $labelUser = document.querySelector('label[for="login_candidatos_form_usuario"]').textContent;
      const $labelPassword = document.querySelector('label[for="login_candidatos_form_senha"]').textContent;
      const $messages = {
        login: 'Insira seu e-mail ou usuário VAGAS',
        password: 'Insira sua senha',
      };

      const isEmail = function(value) {
        const rgx = /^[a-z0-9.-_]+@[a-z0-9-]+\.[a-z]{2,}\.?([a-z]{2,})?\.?([a-z]{2,})?$/;
        return rgx.test(value);
      };

      const checkInputValue = function() {
        return $inputLoginValue.value === '' ? 'valor-indisponível' : (isEmail($inputLoginValue.value) ? 'email' : 'usuario');
      };

      const cleanText = function (text) {
        return text
          .replace(/\s/g, '-')
          .normalize('NFD')
          .replace(/[\u0300-\u036f]/g, '')
          .replace('.', '-')
          .toLowerCase();
      };

      const interactionEvents = function (eventAction) {
        window.dataLayer.push({
          'event': 'interaction',
          'eventCategory': 'login:candidato',
          'eventAction': 'clicou:' + eventAction + '',
          'eventLabel': checkInputValue(),
          'eventValue': 0,
        });
      };

      const nonInteractionEvents = function (eventAction, label) {
        window.dataLayer.push({
          'event': 'nonInteraction',
          'eventCategory': 'login:candidato',
          'eventAction': 'erro:' + eventAction + '',
          'eventLabel': label,
          'eventValue': 0,
        });
      };

      const events = {
        onSubmitLogin: function() {
          if (($inputLoginValue.value === '' && $inputPasswordValue.value === '')) {
            interactionEvents(cleanText($submitLogin.value))
            nonInteractionEvents(cleanText($labelUser), cleanText($messages.login));
            nonInteractionEvents(cleanText($labelPassword), cleanText($messages.password));
            return;
          } else if ($inputLoginValue.value === '') {
            interactionEvents(cleanText($submitLogin.value));
            nonInteractionEvents(cleanText($labelUser), cleanText($messages.login));
            return;
          } else if ($inputPasswordValue.value === '') {
            interactionEvents(cleanText($submitLogin.value));
            nonInteractionEvents(cleanText($labelPassword), cleanText($messages.password));
            return;
          } else {
            return interactionEvents(cleanText($submitLogin.value));
          }
        },

        onCreateProfile: function() {
          return interactionEvents(cleanText($createProfile.textContent));
        },

        onRecoverAccess: function() {
          return interactionEvents(cleanText($recoverAccess.textContent));
        }
      };

      /* CTA => Botão Entrar */
      $submitLogin.addEventListener('click', events.onSubmitLogin);

      /* CTA => Criar Perfil */
      $createProfile.addEventListener('click', events.onCreateProfile);

      /* CTA => Recuperar Acesso */
      $recoverAccess.addEventListener('click', events.onRecoverAccess);
    },

    loading: function(action) {
      const loader =  $('.loading-request-email');
      if(!action) return false;
      return (action === 'show') 
          ? $(loader).addClass('is-active')
          : $(loader).removeClass('is-active');
    },
  }

  loginCandidatos.init();
});

