/**
* Como usar:
* Adicione uma classe "lista-de-paises" ao select de lista de países.
* Adicione um data-target-id="ID_DO_SELECT_DE_DOCUMENTOS" ao select de lista de países.
* Adicione um ID ao select de documentos, igual ao data-target-id do select de países.
**/

(function ($) {
  // Definição e construtor da classe.
  function documentosPorPais() {
    this.setup();
    if (this.$countries.size() > 0) {
      this.bind();
      this.getApiList('/servicos/lista_paises.json', this.$countries) ;
    }
  }

  var proto = documentosPorPais.prototype;

  // Define variaveis globais da classe para uso posterior.
  proto.setup = function() {
    this.selectClass = 'lista-de-paises';
    this.targetIdAttr = 'documentos-target-id';
    this.hasDocumentList = false;
    this.hasCountriesList = false;
    this.$countries = $('.' + this.selectClass);

    if (this.$countries.size() === 0) {
      return false;
    }
    this.hasCountriesList = true;

    var targetId = this.$countries.data('target-id');
    // Flag para caso o select de países não tenhha um data-target-id
    if (typeof targetId !== 'undefined') {
      this.hasDocumentList = true;
      this.$documentList = $('#' + targetId);
    }
  };

  proto.getApiList = function(url, $selectToPopulate, params) {
    var that = this;
    $.ajax({
      'url': url,
      'data': params || {},

      complete: function(data) {
        that.populateSelect(data.responseJSON.utils, $selectToPopulate);
      }
    })
  };

  // SE houver data-target-id, binda o evento de change no select de países para atualizar o de documentos
  proto.bind = function() {
    var that = this;

    if (that.hasDocumentList)
      $('.' + this.selectClass).on('change', {that: this}, that.onChangeCountry);
  };

  proto.onChangeCountry = function(e) {
    var that = e.data.that,
    $selectedCountry = $(this).find('option:selected');
    that.getApiList('/servicos/lista_documentos', that.$documentList, { 'pais_id': $selectedCountry.val() });
  };

  proto.populateSelect = function(items, $select) {
    var that = this,
        defaultValue = $select.data("default-value") || false;
    $select.html('');

    items.forEach(function(item, i) {
      if(!defaultValue && i === 0) {
        var placeholderEl = document.createElement('option');
        placeholderEl.innerHTML = I18n.t('servicos.candidato.senhas.form.selecione');
        placeholderEl.selected = 'selected';
        $select.append(placeholderEl);
      }
      var optionEl = document.createElement('option');
      optionEl.innerHTML = item[0];
      optionEl.value = item[1];
      $select.append(optionEl);

      if(defaultValue && item[1] == defaultValue) {
        optionEl.selected = 'selected';
        $select.trigger('change');
      }
    });
  }

  new documentosPorPais();
})($);
